private static int nextDeletedDoc(int doc, Bits liveDocs, int maxDoc) {
  if (liveDocs == null) {
    return maxDoc;
  }
  while (doc < maxDoc && liveDocs.get(doc)) {
    ++doc;
  }
  return doc;
}

